import React,{useState} from "react";
import { useNavigate, useLocation } from 'react-router-dom'
import "./Home.css";
function Home() {
  const location = useLocation();
  const { show, setShow } = location.state || {};
  const handleShow = () => setShow(true);

  const navigate = useNavigate();
  const addtodo = () => {
    navigate('/anotherpage', { state: { show, setShow } });  }
  return (
      <>
      <div className="container">
        <input type="text" className="search mt-5" placeholder="search . . ."/>
        <button type="button" className="btn btn-warning ms-2 mb-2">Search</button>
        <button type="button" className="btn btn-primary ms-2 mb-2" onClick={() => {
  handleShow();
  addtodo();
}}
>add
        </button>
      </div>
    </>
  );
}

export default Home;
